                    case Enum.AnTuChieu: content = EventLogViResource.AnTuChieu; break;
                    case Enum.HisTreatment_KetThucDieuTriLuuTam: content = EventLogViResource.HisTreatment_KetThucDieuTriLuuTam; break;
                    case Enum.HisTransaction_MoKhoaGiaoDichTamUng: content = EventLogViResource.HisTransaction_MoKhoaGiaoDichTamUng; break;	


                    default: content = defaultViEventLog; break;
                }
            }
            else if (Language == LanguageEnum.EN)
            {
                switch (enumBC)
                {
                    default: content = defaultEnEventLog; break;
                }
            }
            return content;
        }
    }
}
